def thelongrun(a):
    a = bin(int(a,16))
#b = bin(int(b,16))

    count = 0
    last = None
    for char in a:
        if char != last:
            count = 0
            last = char
        if char == last:
            count = count + 1
            last = char
        if last == None:
            last = char
        if count >= 34:
            print("Estourou")
            break


